package com.aspire.daydreaming.bundle.register;import com.aspire.daydreaming.core.base.BaseEntity;import com.aspire.daydreaming.core.base.BaseModel;import com.aspire.daydreaming.core.base.BasePresenter;import com.aspire.daydreaming.core.base.BaseView;import com.aspire.daydreaming.core.model.info.User;import rx.Observable;/** * @Name: RegisterContract * @Author: yeliang * @Date: 2016/8/23 */interface RegisterContract {    interface View extends BaseView {        void onLoading(String msg);        void onComplete(BaseEntity.BaseBean baseBean);        void onError(String errorMsg);    }    interface Model extends BaseModel {        Observable<BaseEntity.BaseBean> register(User userModel);    }    abstract class Presenter extends BasePresenter<Model, View> {        public abstract void register(User userModel);        @Override        public void onStart() {        }    }}